insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0201','净资产负债率','AA01','0001','','03','0001,0009','净资产负债率=所有者权益/总负债×100%','0003','净资产负债率也称为产权比率、债务股权比率，反映由债权人提供的资本与股东提供的资本的相对关系，是衡量银行长期偿债能力的一个重要指标。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0202','流动性比例','AA01','0002','','03','0001,0009','流动性比例=流动性资产/流动性负债×100%','0011','反映银行满足存款人提取现金、支付到期债务和借款人正常贷款需求的能力。该比例越高，表明商业银行的流动性风险越小，但同时也意味着其盈利能力的降低。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0203','核心负债依存度','AA01','0002','','03','0001,0009','核心负债/总负债×100%','0011','也称为“核心负债比例”，考量的是长期偿债能力，反映银行流动性管理能力。核心负债包括距到期日三个月以上（含）定期存款和发行债券以及活期存款的50%。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0204','流动性缺口率','AA01','0002','','03','0001,0009','流动性缺口率=流动性缺口/90天内到期表内外资产×100%','0011','流动性缺口率为90天内表内外流动性缺口与90天内到期表内外流动性资产的比率，一般不应低于-10%。它是衡量商业银行流动性状况及其波动性的流动性风险核心指标之一。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0205','流动性缺口','AA01','0002','','03','0001,0009','流动性缺口=一定期限内到期的资产-相同期限内到期的负债','0011','缺口分析为银行业评估流动性风险状况的重要方法，可利用缺口数据进行进一步的敏感性分析及压力测试。（具体分析期限包含：即期偿还、一个月及以下、1个月至3个月（含）、3个月至1年（含）、1年至5年（含）、5年以上）','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0206','流动性覆盖率','AA01','0002','','03','0001,0009','流动性覆盖率=优质流动性储备/未来30日资金流动性需求×100%','0011','流动性覆盖率旨在确保商业银行在设定的严重流动性压力情景下，能够保持充足的、无变现障碍的优质流动性资产，并通过变现这些资产来满足未来30日的流动性需求。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0207','净稳定融资比例','AA01','0002','','03','0001,0009','净稳定融资比例=银行可用的各项稳定资金来源/各类资产业务所需的稳定资金来源×100%','0011','度量银行较长期限内可使用的稳定资金来源对其表内外资产业务发展的支持能力。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0208','存贷比','AA01','0002','','03','0001,0009','存贷比=贷款和垫款总额/吸收存款×100%','0011','是银行贷款余额与存款余额的比率，反映银行存贷款规模结构及流动性风险。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0209','新增存贷比','AA01','0002','','03','0001,0009','新增存贷比=（本期末贷款和垫款总额-比较期末贷款和垫款总额）/（本期末吸收存款-比较期末吸收存款）×100%','0011','是银行新增贷款余额与本期新吸收存款的比率，反映银行存贷款均衡发展的能力。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0210','超额备付率','AA01','0002','','03','0001,0009','超额备付率＝（超过法定存款准备金的备付金＋库存现金+存放同业款项）÷（存款余额＋应解汇款）×100%','0011','反映银行超额备付金是否缴存充足','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0211','拆入资金比率','AA01','0002','','03','0001,0009','拆入资金比例＝在短期融资市場上拆入的人民币资金余额÷各项人民币存款','0011','该指标反应拆入资金与人民币，用于监测银行的流动性风险。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0212','拆出资金比率','AA01','0002','','03','0001,0009','拆出資金比例＝在短期融資市場上拆出的人民币资金余额÷各項人民币存款','0011','该指标反应拆出资金与人民币存款的比率，用于监测银行的流动性风险。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0213','每亿元跨行交易量产生的流动性成本','AA01','0002','','03','0001,0009','每亿元跨行交易量产生的流动性成本=流动性成本总额/工作日天数/日均交易量*10000','0011','反映银行流动性成本水平。','0002','0009','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0214','流动性日均偏差率','AA01','0002','','03','0001,0009','流动性日均偏差率=预测偏差汇总/工作日天数/日均交易量','0011','反映银行流动性预测准确性。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0215','资金头寸预报准确率','AA01','0002','','03','0001,0009','流动性日均偏差率=∑每日实际资金头寸发生额/∑每日资金头寸预报额','0011','反映每日资金流入流出金额预测准确率。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0216','往来资金核实率','AA01','0002','','03','0001,0009','往来资金核实率=公司客户实际未对账户数÷应对账总户数+往来资金挂账平均超时天数÷365+人行大小额支付清算逾期笔数÷人行大小额支付清算要求处理总笔数','0011','反映银行往来资金核实情况。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0217','或有负债','AA01','0002','','03','0001,0009','或有负债=经营租赁承诺+资本性承诺+抵质押资+国债承兑承诺+法律诉讼及索赔+信用承诺','0011','指由过去的交易或事项形成的潜在义务，是银行可能的经济利益流出','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0218','或有负债比率','AA01','0002','','03','0001,0009','或有负债比率=或有负债余额/所有者权益。','0011','指企业或有负债总额与股东权益总额的比率，反映银行股东权益应对可能发生的或有负债的保障程度。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0219','未来30日现金净流出','AA01','0002','','03','0001,0009','未来30日现金净流出=未来30日现金流出- min (未来30日现金流入, 未来30日现金流出的75%)，','0011','计算口径：未来30日现金流出=期限内融资偿付+项目计划出资+经费计划支出+其他支出，未来30日现金流入=项目计划回款+协议性融资计划+其他收入','0002','0009','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0220','久期缺口','AA01','0002','','03','0001,0009','久期缺口=资产加权平均剩余期限-负债加权平均剩余期限','0011','计算口径：按照主要资产、负债类别分别计算，资产分为：货币资金；项目资产；固定资产、投资性房地产和长期股权投资（久期假设为36个月）；其他资产（久期假设为36个月）；负债分为：短期借款；其他短期借款（久期假设为12个月）；递延所得税负债（久期假设为36个月）；长期借款','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0221','累计外汇敞口头寸比例','AA01','0003','','03','0001,0009','累积外汇敞口头寸比例=累计外汇敞口头寸／资本净额×100%','0011','衡量商业银行因汇率变化而面临的风险，为累计外汇敞口头寸与资本净额之比，不应高于20%。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0222','利率风险敏感度','AA01','0003','','03','0001,0009','利率风险敏感度=利率上升200个基点对银行净值影响/资本净额×100%。','0011','衡量商业银行因利率变化而面临的风险，为利率上升某个基点对银行净值的影响与资本净额之比','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0223','利率重定价敞口分析','AA01','0003','','03','0001,0009','利率风险敞口=该期限内到期的资产余额-该期限内的到期的负债余额','0011','按照各类生息资产与计息负债的利率重定假日与到期日孰早判断利率风险的归属期限，并计算各期限的风险敞口（具体分析期限包含：即期偿还、一个月及以下、1个月至3个月（含）、3个月至1年（含）、1年至5年（含）、5年以上）','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0224','利率敏感性分析','AA01','0003','','03','0001,0009','假设收益率曲线向上或向下平移25BP对于利息净收入产生的影响','0011','该指标反映利率变动对于银行利息净收入的影响','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0225','外汇风险敞口','AA01','0003','','03','0001,0009','外汇风险敞口=该币种内资产余额-该币种内负债余额','0011','按币种列示各类资产负债余额，并计算敞口','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0226','外汇敏感性分析','AA01','0003','','03','0001,0009','假设汇率向上或向下浮动1%，计算对银行税后净利润及权益的影响','0011','该指标反映了汇率上下浮动1%对于银行税后净利润及权益的影响。','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0227','资本充足率','AA01','0004','','03','0001,0009','资本充足率=资本净额/风险加权资产×100%','0007','资本充足率是指银行自身资本和加权风险资产的比率，代表了银行对负债的最后偿债能力。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0228','一级资本充足率','AA01','0004','','03','0001,0009','一级资本充足率=（核心一级资本-核心一级资本扣除项目+其他一级资本）/风险加权资产×100%','0007','核心资本又叫一级资本，一级资本包括是核心一级资本和其他一级资本，是衡量银行资本充足状况的指标。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0229','核心一级资本充足率','AA01','0004','','03','0001,0009','资本充足率=（核心一级资本-核心一级资本扣除项目）/风险加权资产×100%','0007','核心一级资本充足率是指银行核心一级资本和加权风险资产的比率。核心一级资本包括：实收资本或普通股、资本公积、盈余公积、一般风险准备、未分配利润和少数股东资本可计入部分等 。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0230','资本净额','AA01','0004','','03','0001,0009','资本净额=一级资本净额+二级资本','0007','是指符合监管当局对合格资本法规定义的银行发行的合格资本工具，包括：核心资本，股东权益、公开储备等','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0231','核心一级资本','AA01','0004','','03','0001,0009','核心一级资本=实收资本+资本公积+盈余公积+未分配利润+少数股权','0007','核心一级资本是商业银行资本中最稳定、质量最高的部分，可以长期用来吸收银行在经营管理过程中所产生的损失。核心资本是金融机构可以永久使用和支配的自有资金，至少要占资本总额的50%，不得低于兑现金融资产总额的4%。','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0232','核心一级资本扣除项目','AA01','0004','','03','0001,0009','/','0007','银行在计算资本充足率时，要从核心资本中扣除以下项目：商誉；对未并表金融机构的资本投资；对非自用不动产或企业投资；无形资产等','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0233','核心一级资本净额','AA01','0004','','03','0001,0009','核心一级资本净额=核心一级资本-核心一级资本扣除项目','0007','核心一级资本是核心一级资本减去核心一级资本扣除项目','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0234','其他一级资本','AA01','0004','','03','0001,0009','其他一级资本=其他一级资本工具溢价+少数股东资本可计入部分','0007','其他一级资本是一级资本的组成部分，包括其他一级资本工具及其溢价和少数股东资本可计入部分','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0235','二级资本','AA01','0004','','03','0001,0009','二级资本=重估储备+一般准备+长期次级债务','0007','二级资本也成为附属资本，主要包括重估储备、普通呆账准备、混合型债务资本工具等','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0236','最低资本','AA01','0004','','03','0001,0009','最低资本=风险加权资产*8%','0007','是指银行为满足监管要求，所需持有的最低的资本','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0237','超额资本','AA01','0004','','03','0001,0009','超额资本=资本净额-最低资本','0007','资本净额与最低资本要求之差。','0002','0009','N','Y','机构维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0238','经济资本','AA01','0004','','03','0001,0002,0003,0005,0006,0007,0008,0009','经济资本=信用风险的非预期损失+市场风险的非预期损失+操作风险的非预期损失。','0007','从银行所有者和管理者的角度讲，经济资本就是用来承担非预期损失和保持正常经营所需的资本。经济资本是描述在一定的置信度水平上（如99%），一定时间内（如一年），为了弥补银行的非预计损失（UL,unexpected losses）所需要的资本。它是根据银行资产的风险程度的大小计算出来的。计算经济资本的前提是必须要对银行的风险进行模型化、量化。','0002','0009','N','Y','组合维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0239','经济资本均值','AA01','0004','','03','0001,0002,0003,0005,0006,0007,0008,0009','经济资本均值=（期初经济资本+期末经济资本）/2','0007','经济资本平均值','0002','0009','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0240','信用风险经济资本','AA01','0004','','03','0001,0002,0003,0005,0006,0007,0008,0009','（资产账面价值-合格风险缓释）×经济资本系数+合格风险缓释工具×风险权重×12.5%','0007','商业银行在一定置信水平下，为应对未来一定期限内信用风险资产的非预期损失而应当持有的资本金','0002','0009','N','Y','组合维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0241','操作风险经济资本','AA01','0004','','03','0001,0002,0003,0005,0006,0007,0008,0009','商业银行前三年总收入的平均值*15%','0007','商业银行在未来一段时间内为应对操作失误带来的损失而应持有的资本金','0002','0009','N','Y','组合维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0242','市场风险经济资本','AA01','0004','','03','0001,0002,0003,0005,0006,0007,0008,0009','资产VaR值*市场风险系数','0007','商业银行在一定置信水平下，为应对未来一定期限内市场风险资产的非预期损失而应当持有的资本金','0002','0009','N','Y','组合维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0243','经济资本限额','AA01','0004','','03','0001,0002,0003,0005,0006,0007,0008,0009','根据领导决议而制定','0007','根据公司经济资本配置方案，对各经营单位分解下达的经济资本占用上限。通常年初设定，年内会有调整。','0002','0009','N','Y','组合维度指标查询',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0244','经济资本限额占用率','AA01','0004','','03','0001,0002,0003,0005,0006,0007,0008,0009','经济资本占用/经济资本限额','0007','衡量各经营单位经济资本使用占经济资本限额情况。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0245','经济资本杠杆率','AA01','0004','','03','0001,0009','经济资本占用/表内外总资产其中：表内外总资产=表内总资产+表外总资产','0007','经济资本占用/表内外总资产','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0246','净资本与风险准备比率','AA01','0004','','03','0001,0009','资本净额/风险准备×100%','0007','指资本净额与风险准备的比率。风险准备是指金融机构按规定从净利润中提取，用于弥补亏损的风险准备。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
