insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0312','成本费用利润率（含直接成本）','AA04','0013','0004','03','0001,0002,0003,0005,0006,0008,0009','利润总额（含直接成本）/营业成本（含直接成本）×100%','0010','成本费用利润率是企业一定期间的利润总额与成本、费用总额的比率。成本费用利润率指标表明每付出一元成本费用可获得多少利润，体现了经营耗费所带来的经营成果。该项指标越高，利润就越大，反映企业的经济效益越好。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
