insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0350','单点钞币运送费','AA04','0014','0004','03','0001,0009','钞币运送费/（二级支行数量+离行式自助银行数量+离行单台自助设备数量）','0010','反映平均每个二级支行、离行式自助银行和离行单台自助设备消耗的钞币运送费','0002','0010','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
