insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0352','人均劳动保护费','AA04','0014','','03','0001,0009','劳动保护费/平均从业人数','0010','反映人均耗费的劳动保护费','0002','0013','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0353','企业所得税实缴税额变动率','AA04','0014','0007','03','0001,0009','（本期实缴所得税额-上期实缴所得税额）/上期实缴所得税额*100%','0009','企业所得税实缴税额变动率，是本期实缴所得税增长额占上期实缴所得税额的比例。通过企业所得税实缴税额变动率，可以直接了解企业所得税实缴税额的变化情况，分析其变化原因，看是否存在可能的改进空间；此外，企业所得税实缴税额变化情况也会对企业的未来预算、采购管理等方面产生间接影响。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0354','企业所得税应纳税额变动率','AA04','0014','0007','03','0001,0009','（本期应纳所得税额-上期应纳所得税额）/上期应纳所得税额*100%','0009','企业所得税应纳税额变动率，是本期应纳所得税增长额占上期应纳所得税额的比例。通过企业所得税应纳税额变动率，可以直接了解企业所得税应纳税额的变化情况，分析其变化原因，看是否存在可能的改进空间；此外，企业所得税应纳税额变化情况也会对企业的未来预算、采购管理等方面产生间接影响。关注企业处于税收优惠期前后，该指标如果发生较大变化，可能存在少计收入、多列成本，人为调节利润问题；也可能存在费用配比不合理等问题。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0355','企业所得税税负率','AA04','0014','0007','03','0001,0009','本期应纳所得税额/本期利润总额*100%','0009','企业所得税税负率即税收负担率，是企业所得税应纳税额与利润总额的比率，较直观地体现了企业所得税的税负情况。分析测算企业所得税税负，与同行业水平相比较，若高于预警值暂视为正常，若低于预警值的，则可能存在以下原因：1、政策因素；2、税法与会计差异调整的正确性；3、弥补亏损等等。评估企业如为亏损企业,该指标等于零。 ','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0356','企业所得税贡献率','AA04','0014','0007','03','0001,0009','本期应纳所得税额/本期营业收入*100%','0009','企业所得税贡献率，反映的是企业所得税缴纳税额与收入的比例关系，在对所得税进行纳税评估时最为关注的指标。贡献率的高低能反映企业的盈利情况。如果贡献率偏低，评估人员会根据行业特性分析后，认为企业可能存在少计收入、多列支成本费用的情况，比如商业零售企业会存在账外收入；建安企业收入不按照工程进度及时纳税而是按照收款进度来确认收入结转和纳税、以虚假发票等多列支成本费用情况。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0357','企业所得税应纳税额变动率与营业利润变动率同步分析','AA04','0014','0007','03','0001,0009','企业所得税应纳税额变动率/营业利润变动率*100%','0009','企业所得税应纳税额变动率与营业利润变动率应同步变化，与同行业相比较，若高于预警值暂视为正常，若低于预警值的，则可能存在以下原因：1、政策因素；2、税法与会计差异调整的正确性。同时应检查企业是否存在销售未计收入、多列成本费用、扩大税前扣除范围等问题，并作进一步分析。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0358','企业所得税应纳税额变动率与利润总额变动率同步分析','AA04','0014','0007','03','0001,0009','企业所得税应纳税额变动率/利润总额变动率*100%','0009','企业所得税应纳税额变动率与利润总额变动率应同步变化。与当地同行业同期和本企业基期所得税负担率相比，高于预警值暂视为正常，若低于预警值的，则可能存在不计或少计销售（营业）收入、多列成本费用、扩大税前扣除范围等问题，运用其它相关指标深入评估分析。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0359','实际税率变动','AA04','0014','0007','03','0001,0009','（当期实际税率-上期实际税率）/上期实际税率*100%','0009','实际税率为实际缴纳的企业所得税额占应纳税所得额的比率，分析实际税率的变化，有助于企业的应纳税所得额结构变化以及税收政策对于企业纳税额的影响。帮助企业控制与分析税务风险。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0360','增值税实缴税额变动率','AA04','0014','0008','03','0001,0009','（本期实缴增值税额-上期实缴增值税额）/上期实缴增值税额*100%','0009','增值税实缴税额变动率，是本期实缴增值税增长额占上期实缴增值税额的比例。通过企业增值税实缴税额变动率，可以直接了解企业增值税实缴税额的变化情况，分析其变化原因，看是否存在可能的改进空间；此外，企业增值税实缴税额变化情况也会对企业的未来预算、采购管理等方面产生间接影响。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0361','销项税额变动率','AA04','0014','0008','03','0001,0009','（本期销项税额-上期销项税额）/上期销项税额*100%','0009','销项税额变动率，是本期销项税额增长额占上期销项税额的比例。该比值反映企业销项税额的变动情况，应与销售收入变动率同步分析，分析企业是否存在少计收入、虚报成本的情况。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0362','进项税额变动率','AA04','0014','0008','03','0001,0009','（本期进项税额-上期进项税额）/上期进项税额*100%','0009','进项税额变动率，是本期进项税额增长额占上期进项税额的比例。该比值反映企业进项税额的变动情况，应与销项税额变动率同步分析。通过抵扣项目的增减变化，分析企业是否存在虚假抵扣现象。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0363','增值税应纳税额变动率','AA04','0014','0008','03','0001,0009','（本期应纳增值税额-上期应纳增值税额）/上期应纳增值税额*100%','0009','增值税应纳税额变动率，是本期应纳增值税增长额占上期应纳增值税额的比例。通过增值税应纳税额变动率，可以直接了解增值税应纳税额的变化情况，分析其变化原因，看是否存在可能的改进空间。弹性系数小于预警值，则企业可能有少缴税金的问题。应通过其他相关纳税评估指标与评估方法，并结合纳税人生产经营的实际情况进一步分析，对其申报真实性进行评估。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0364','增值税应税收入变动率','AA04','0014','0008','03','0001,0009','（本期增值税应税收入-上期增值税应税收入）/上期增值税应税收入*100%','0009','增值税应税收入变动率，是本期增值税应税收入增长额占上期增值税应税收入的比例。该比值用于分析企业应税收入变动情况，低于预警值，则应重点检查企业是否存在视同销售未计收入、少计收入的情况。可与增值税应纳税额变动率、城建税变动率、教育费附加变动率等指标同步分析，了解企业的税款缴纳情况。一般而言，可以将增值税税负率和应税收入变动率与相应的正常峰值（可根据企业或行业的历史数据进行确认）进行比较，当应税收入变动率高于正常峰值，增值税税负率低于正常峰值时，此时需要重点关注进项税额，看进项税额抵扣范围是否正确，或是否存在销售收入未进行增值税纳税申报等异常情况出现。当应税收入变动率低于正常峰值，增值税税负率低于正常峰值的和应税收入变动率及增值税税负率均高于正常峰值时，此时需要重点关注销项税额，看销项税额计算是否正确等。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0365','增值税税负率','AA04','0014','0008','03','0001,0009','本期增值税应纳税额/本期增值税应税收入*100%','0009','增值税税负率即税收负担率，是增值税应纳税额与课税对象的比率，较直观地体现了企业实现增值税的能力和负担水平。通过不同历史时期增值税税负的比较，可以直接了解企业增值税税负变化情况，分析增值税税负变化原因，看是否存在可能的改进空间；此外，增值税税负变化情况也会对未来预算、资金占用量管理等方面产生间接影响。增值税税负率产生变化的影响因素较多，涉及增值税税基的多个方面。因此，用该法发现企业增值税税负异常时，应结合其他分析方法进行多角度分析。常需要综合考虑的方面：（1）是否受外部大环境和/或季节性因素影响。如：企业生产经营受外部环境和/或季节的影响变化，本期进入销售淡季，造成应税销售收入降低，同时，为销售旺季准备生产，购进货物大幅增加，造成购销失衡等。（2）政策性因素。如：出口企业本期出口销售额占销售总额的比例突然增加，直接免抵税额增加，应纳税额减少，税负降低。（3 ）价格因素。受外部市场竞争和大环境的影响，企业经营的货物价格本期大幅度下降，增值额减少，增值税税负降低。（4 ）经营范围发生较大变化等特殊情况。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0366','增值税应税收入占营业收入比例','AA04','0014','0008','03','0001,0009','本期增值税应税收入/本期营业收入*100%','0009','增值税应税收入与营业收入的区别在于是否有非增值税应税收入。低于预警值时，应重点检查以下几个方面：1、企业的经营收入有无非增值税应税收入，比如营业税收入，这就造成所得税营业收入大于增值税收入；2、增值税应税收入有无发生销售折让、销货退回等情况；3、会计与税法差异，税法规定确认收入缴纳增值税，但会计不确认收入。比如购买方陷入困境，预期不能按时取得收入，但销售已实现，增值税纳税义务已产生；4、在外币折算方面，增值税与所得税的规定也有差异。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0367','增值税应纳税额变动率与营业收入变动率同步分析','AA04','0014','0008','03','0001,0009','增值税应纳税额变动率/营业收入变动率*100%','0009','该指标分析增值税应纳税额变动率与营业收入变动率是否同步。正常情况下，二者应同步增长。指标出现异常时，应检查企业是否存在实现销售收入而不计提销项税额或扩大抵扣范围而多抵进项的问题。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0368','增值税应纳税额变动率与应税收入变动率同步分析','AA04','0014','0008','03','0001,0009','增值税应纳税额变动率/增值税应税收入变动率*100%','0009','该指标用于判断企业是否存在实现销售收入而不计提销项税额或扩大抵扣范围而多抵进项的问题。正常情况下两者应基本同步增长，弹性系数应接近1。若弹性系数>1且二者都为正数行业内纳税人可能存在本企业将自产产品或外购货物用于集体福利、在建工程等，不计收入或未做进项税额转出等问题；当弹性系数<1且二者都为负数可能存在上述问题；弹性系数小于1，二者都为正时，无问题；二者都为负时，可能存在上述问题；当弹性系数为负数，前者为正后者为负时，可能存在上述问题；后者为正前者为负时，无问题。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0376','印花税实缴税额变动率','AA04','0014','0008','03','0001,0009','（本期实缴印花税额-上期实缴印花税额）/上期实缴印花税额*100%','0009','印花税实缴税额变动率，是本期实缴印花税增长额占上期实缴印花税额的比例。通过企业印花税实缴税额变动率，可以直接了解企业印花税实缴税额的变化情况，分析其变化原因，看是否存在可能的改进空间；此外，企业印花税实缴税额变化情况也会对企业的合同管理等方面产生间接影响。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0377','印花税应纳税额变动率','AA04','0014','0008','03','0001,0009','（本期应纳印花税额-上期应纳印花税额）/上期应纳印花税额*100%','0009','印花税应纳税额变动率，是本期应纳印花税增长额占上期应纳印花税额的比例。通过印花税应纳税额变动率，可以直接了解企业印花税应纳税额的变化情况，分析其变化原因，看是否存在可能的改进空间；此外，印花税应纳税额变化情况也会对企业未来的合同管理产生间接影响。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0378','印花税应税收入变动率','AA04','0014','0008','03','0001,0009','（本期印花税应税收入-上期印花税应税收入）/上期印花税应税收入*100%','0009','印花税应税收入变动率，是本期印花税应税收入增长额占上期印花税应税收入的比例。该比值用于分析印花税应税收入变动情况，低于预警值，则应重点检查企业是否存在印花税应税行为而未计收入、少计收入的情况。可与印花税应纳税额变动率等指标同步分析，了解企业的印花税税款缴纳情况。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0379','印花税应纳税额变动率与印花税应税收入变动率同步分析','AA04','0014','0008','03','0001,0009','印花税应纳税额变动率/印花税应税收入变动率*100%','0009','本指标用于分析印花税应纳税额变动率与印花税应税收入变动率，评估纳税人申报（贴花）纳税情况真实性。适用于工商、建筑安装等行业应纳税额变动率与印花税应税收入变动率对比分析。正常情况下二者应基本同步增长，比值应接近1.当比值小于1，可能存在未足额申报印花税问题。分析中发现高于或低于预警值的，要借助其他指标深入分析并按照总局纳税评估管理办法规定处理。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0380','房产税实缴税额变动率','AA04','0014','0008','03','0001,0009','（本期实缴房产税额-上期实缴房产税额）/上期实缴房产税额*100%','0009','房产税实缴税额变动率，是本期实缴房产税增长额占上期实缴房产税额的比例。通过企业房产税实缴税额变动率，可以直接了解房产税实缴税额的变化情况，分析其变化原因，看是否存在可能的改进空间；此外，房产税实缴税额变化情况也会对企业未来的房产采购、建造、租用等方面产生影响。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0381','房产税应纳税额变动率','AA04','0014','0008','03','0001,0009','（本期应纳房产税额-上期应纳房产税额）/上期应纳房产税额*100%','0009','房产税应纳税额变动率，是本期应纳房产税增长额占上期应纳房产税额的比例。通过房产税应纳税额变动率，可以直接了解企业房产税应纳税额的变化情况，分析其变化原因，看是否存在可能的改进空间；此外，房产税实缴税额变化情况也会对企业未来的房产采购、建造、租用等方面产生影响。低于预警值时，应检查企业是否存在不计、少计房产税的情况。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0382','房产原值变动率','AA04','0014','0008','03','0001,0009','（本期房产原值-上期房产原值）/上期房产原值*100%','0009','房产原值变动率，是本期房产原值增长额占上期房产原值的比例。该比值用于分析房产原值的变动情况。可与房产税应纳税额变动率等指标同步分析，了解企业的房产税税款缴纳情况。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0383','房产税应纳税额变动率与房产原值变动率同步分析','AA04','0014','0008','03','0001,0009','房产税应纳税额变动率/房产原值变动率*100%','0009','该指标分析房产税应纳税额变动率与房产原值变动率是否同步。正常情况下，二者应基本同步增长。指标出现异常时，应检查企业是否存在不计、少计房产原值，计税方法错误、减少应纳税款等问题。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0384','城镇土地使用税实缴税额变动率','AA04','0014','0008','03','0001,0009','（本期实缴房产税额-上期实缴房产税额）/上期实缴房产税额*100%','0009','城镇土地使用税实缴税额变动率，是本期实缴城镇土地使用税增长额占上期实缴城镇土地使用税额的比例。通过城镇土地使用税实缴税额变动率，可以直接了解企业城镇土地使用税实缴税额的变化情况，分析其变化原因，看是否存在可能的改进空间；此外，城镇土地使用税实缴税额变化情况也会对企业未来的土地使用情况等方面产生影响。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0385','城镇土地使用税应纳税额变动率','AA04','0014','0008','03','0001,0009','（本期应纳房产税额-上期应纳房产税额）/上期应纳房产税额*100%','0009','城镇土地使用税应纳税额变动率，是本期应纳城镇土地使用税增长额占上期应纳城镇土地使用税额的比例。通过城镇土地使用税应纳税额变动率，可以直接了解企业城镇土地使用税应纳税额的变化情况，分析其变化原因，看是否存在可能的改进空间；此外，城镇土地使用税应纳税额变化情况也会对企业未来的土地使用情况等方面产生影响。当该比例低于预警值时，应检查企业是否存在少计土地使用数量、错用税率的情况。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0386','土地原值变动率','AA04','0014','0008','03','0001,0009','（本期土地原值-上期土地原值）/上期土地原值*100%','0009','土地原值变动率，是本期土地原值增长额占上期土地原值的比例。该比值用于分析土地原值的变动情况。可与城镇土地使用税应纳税额变动率等指标同步分析，了解企业的城镇土地使用税税款缴纳情况。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
insert into f_app.T_INDEX_INFO ( INDEX_NO,INDEX_NAME,INDEX_TYP1,INDEX_TYP2,INDEX_FREQUENCY,MATN_STAT,DIM,FRML_CALC,DATA_SRC,INDEX_DEF,INDEX_ACCURACY,INDEX_UNIT,EXTEND,IS_COMMIT,STDBY1,CREATE_DATE,VALID_DATE,INVLDTN_DATE ) values ('Z0387','城镇土地使用税应纳税额变动率与土地原值变动率同步分析','AA04','0014','0008','03','0001,0009','城镇土地使用税应纳税额变动率/土地原值变动率*100%','0009','该指标分析城镇土地使用税应纳税额变动率与土地原值变动率是否同步。正常情况下，二者应基本同步增长。指标出现异常时，应检查企业是否存在不计、少计土地原值，错用税率、减少应纳税款等问题。','0002','0001','Y','Y','',to_date('2016-09-21','yyyy-mm-dd'),to_date('2016-09-21','yyyy-mm-dd'),to_date('2999-12-31','yyyy-mm-dd'));
